import { useParams } from "react-router";
import useFetch from "./useFetch";

const ParkDetails = () => {
    const { id } = useParams()
    const { data, error, isPending } = useFetch('https://developer.nps.gov/api/v1/parks?parkCode=' + id + '&limit=10&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE');
    return (
        <div className="park-details">
            <h2>
                Park Details
            </h2>
        </div>
    );
}

export default ParkDetails;
